// SPDX-License-Identifier: MIT
pragma solidity >=0.8.17;

import "../lzApp/NonblockingLzApp.sol";

/*
    LayerZero mumbai
      lzChainId:10109 lzEndpoint: 0xf69186dfBa60DdB133E91E9A4B5673624293d8F8
      contract: 
    LayerZero tcore
      lzChainId:10153 lzEndpoint: 0xae92d5aD7583AD66E49A0c67BAd18F6ba52dDDc1
      contract: 
*/

contract LayerZeroTest is NonblockingLzApp {
    string public data = "Nothing received yet";
    uint16 destChainId;
    
    constructor(address _lzEndpoint) NonblockingLzApp(_lzEndpoint) {
        if (_lzEndpoint == 0xf69186dfBa60DdB133E91E9A4B5673624293d8F8) destChainId = 10153;
        if (_lzEndpoint == 0xbfD2135BFfbb0B5378b56643c2Df8a87552Bfa23) destChainId = 10109;
    }

    function _nonblockingLzReceive(uint16, bytes memory, uint64, bytes memory _payload) internal override {
       data = abi.decode(_payload, (string));
    }

    function send(string memory _message) public payable {
        bytes memory payload = abi.encode(_message);
        _lzSend(destChainId, payload, payable(msg.sender), address(0x0), bytes(""), msg.value);
    }

    function trustAddress(address _otherContract) public onlyOwner {
        trustedRemoteLookup[destChainId] = abi.encodePacked(_otherContract, address(this));   
    }
}

